import React from "react";

// Proptypes
import PropTypes from "prop-types";

// Styles
import { Wrapper, Content } from "./Header.styles";

const Header = ({ title }) => (
  <Wrapper>
    <Content>
      <h1>{title}</h1>
    </Content>
  </Wrapper>
);

Header.default

Header.propTypes = {
  title: PropTypes.string.isRequired,
};

export default Header;
